import React, { Component } from 'react';
import logo from './logo.svg';
import axios from 'axios';
import './App.css';
import sai from './sai';
import { HashRouter as Router, Route, Link } from 'react-router-dom';
import { Card, CardImg, CardText, CardBody, CardTitle, CardSubtitle, Button,Row, Col,Container } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.css';
class Form extends Component {

  constructor(props){
    super(props);

    this.state = {
      stories:[]
    }

    axios.post('http://10.90.90.102:3002/').then(res=>{

      if(res.data.status == "success"){

        this.setState({stories:res.data.story});
       console.log(this.state.stories);

      }


    })

  }
  render() {

    return (

      <div>
      <Container>
        <Row>
          <Col sm="2"><h2><b>Medium</b></h2></Col>
          <Col sm="6"></Col>
          <Col sm="4">
            <Row>
              <Col sm='6'><a href="#" className="btn btn-outline-info">Become a member</a></Col>
              <Col sm='3'><a href="#" className="btn btn-outline-info">signup</a></Col>
              <Col sm='3'><a href="#" className="btn btn-outline-info" >getStarted</a></Col>
            </Row>

          </Col>
        </Row> 
      </Container>
      <Container>
        <Nav>
          <NavItem>
            <NavLink href="#">Link</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#">Link</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#">Another Link</NavLink>
          </NavItem>
          <NavItem>
            <NavLink disabled href="#">Disabled Link</NavLink>
          </NavItem>
        </Nav>
      </Container>
      </div>
    );
  }
}

export default Form;
